[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pubtator", "sparql_query": "
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX pubtator: <http://www.ncbi.nlm.nih.gov/pubtator/>

SELECT DISTINCT ?disease ?diseaseLabel
WHERE {
  ?annotation pubtator:hasPMID "18935173" ;
              pubtator:hasAnnotation ?disease .
  ?disease rdf:type pubtator:Disease ;
           rdfs:label ?diseaseLabel .
}
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "pubtator"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pubtator", "sparql_query": "
PREFIX oa: <http://www.w3.org/ns/oa#>
PREFIX dcterms: <http://purl.org/dc/terms/>

SELECT ?diseaseId
FROM <http://rdfportal.org/dataset/pubtator_central>
WHERE {
  ?ann a oa:Annotation ;
       dcterms:subject "Disease" ;
       oa:hasBody ?diseaseId ;
       oa:hasTarget <http://rdf.ncbi.nlm.nih.gov/pubmed/18935173> .
}
"}}, {"name": "mcp__togomcp__find_terms", "input": {"dictionary": "MeSH", "ids": "D001724,D001835,D003920"}}, {"name": "mcp__pubdictionaries__find_terms", "input": {"dictionary": "MeSH", "ids": "D001724,D001835,D003920"}}, {"name": "mcp__togomcp__search_mesh_entity", "input": {"query": "D001724", "limit": 1}}, {"name": "mcp__togomcp__search_mesh_entity", "input": {"query": "D001835", "limit": 1}}, {"name": "mcp__togomcp__search_mesh_entity", "input": {"query": "D003920", "limit": 1}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mesh", "sparql_query": "
