  ?meshId rdfs:label ?label .
}
"}}, {"name": "mcp__ols__fetch", "input": {"id": "mesh+http://identifiers.org/mesh/D001724"}}, {"name": "mcp__ols__fetch", "input": {"id": "mesh+http://identifiers.org/mesh/D001835"}}, {"name": "mcp__ols__fetch", "input": {"id": "mesh+http://identifiers.org/mesh/D003920"}}, {"name": "mcp__ols__searchClasses", "input": {"query": "D001724", "ontologyId": "mesh", "pageSize": 1}}, {"name": "mcp__ols__searchClasses", "input": {"query": "D001835", "ontologyId": "mesh", "pageSize": 1}}, {"name": "mcp__ols__searchClasses", "input": {"query": "D003920", "ontologyId": "mesh", "pageSize": 1}}]

[{"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "glycosmos"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "glycosmos"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "glycosmos", "sparql_query": "PREFIX glycan: <http://purl.jp/bio/12/glyco/glycan#>
PREFIX glycoconjugate: <http://purl.jp/bio/12/glyco/conjugate#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?protein ?label (COUNT(?site) as ?siteCount)
FROM <http://rdf.glycosmos.org/glycoprotein>
WHERE {
  ?protein a glycan:Glycoprotein ;
    glycan:has_taxon <http://identifiers.org/taxonomy/9606> ;
    glycoconjugate:glycosylated_at ?site .
  OPTIONAL { ?protein rdfs:label ?label }
}
GROUP BY ?protein ?label
ORDER BY DESC(?siteCount)
LIMIT 10"}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "P98164", "limit": 1}}]
